import axios from "axios";
import React, { useEffect } from "react";

import "./styles.css";

const Posts = () => {
  let posts = {};

  useEffect(() => {
    posts = axios.get("http://localhost:5000/posts");
    console.log(posts);
  }, []);

  return <div className="Posts"></div>;
};

export default Posts;
